executeFunc(initOrderPackage);function initOrderPackage(){let orderpackageWarehouse=document.getElementById("package_order_form_invariable_profile");if(orderpackageWarehouse===null){return false}orderpackageWarehouse.addEventListener("change",changeObjectPackageWarehouse,false);return true}function changeObjectPackageWarehouse(){const requestModalName=new XMLHttpRequest;requestModalName.responseType="document";let PackageOrderForm=document.forms.package_order_form;disabledElementsForm(PackageOrderForm);let formData=new FormData;formData.append(this.getAttribute("name"),this.value);requestModalName.open(PackageOrderForm.getAttribute("method"),PackageOrderForm.getAttribute("action"),true);requestModalName.setRequestHeader("X-Requested-With","XMLHttpRequest");requestModalName.addEventListener("readystatechange",function(){if(requestModalName.readyState===4&&requestModalName.status===200){let result=requestModalName.response.getElementById("modal-body");result.querySelectorAll('[data-select="select2"]').forEach(function(item){new NiceSelect(item,{searchable:true})});document.getElementById("modal-body").replaceWith(result);initOrderPackage()}enableElementsForm(PackageOrderForm);return false});requestModalName.send(formData)}